import axios from 'axios';
export default {
  data() {
    return {
      name: '',
      email: '',
      password: '',
      password_confirmation: ''
    };
  },
  methods: {
    register() {
      axios.post('http://127.0.0.1:8000/register', {
        name: this.name,
        email: this.email,
        password: this.password,
        password_confirmation: this.password_confirmation
      }).then(response => {
        // 회원가입 성공 처리
        console.log(response.data);
      }).catch(error => {
        // 오류 처리
        console.error(error);
      });
    }
  }
};
